import Container from "./Container";

function Contact(){
    return(
        <>
         <Container>
            <section>
                <div>
                    <div>
                        <h4>CONTACT</h4>
                        <h2>CONTACT</h2>
                    </div>
                    <div></div>
                </div>
            </section>
         </Container>
        </>
    )
}

export default Contact;
